mapper.select:

select 

from ADMS_CORS_MAJ_MDT
where ADMS_CORS_NO = #{admsCorsNo,jdbcType=INTEGER}
  and DETL_MAJ_CODE = #{detlMajCode,jdbcType=VARCHAR}
  and GRP_LEVEL = #{grpLevel,jdbcType=INTEGER}
  and DOC_ITEM_GRP = #{docItemGrp,jdbcType=VARCHAR}
  and DOC_ITEM_CODE = #{docItemCode,jdbcType=VARCHAR}
  and DOC_TYPE_CODE = #{docTypeCode,jdbcType=VARCHAR}

mapper.delete:

delete from ADMS_CORS_MAJ_MDT
where ADMS_CORS_NO = #{admsCorsNo,jdbcType=INTEGER}
  and DETL_MAJ_CODE = #{detlMajCode,jdbcType=VARCHAR}
  and GRP_LEVEL = #{grpLevel,jdbcType=INTEGER}
  and DOC_ITEM_GRP = #{docItemGrp,jdbcType=VARCHAR}
  and DOC_ITEM_CODE = #{docItemCode,jdbcType=VARCHAR}
  and DOC_TYPE_CODE = #{docTypeCode,jdbcType=VARCHAR}

mapper.update:

